(3, 3, 104, 2, 3, '2018-02-27 15:20:06', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Kan niet inloggen in het CMS. Players zijn offline + slecht wifi netwerk', 'De klant kon niet inloggen omdat hij zijn wachtwoord vergeten was. Die kon Peter niet resetten i.m.v. hij een wachtwoord vergeten had aangevraagd. De klant heeft een slecht wifi netwerk. Krijgt van KPN Z.M.S te horen wanneer hij een nieuwe modem krijgt. Wij krijgen hierover terugkoppeling Players zijn ook offline. Dit gaan we oppakken zodra de klant een muis bij de hand heeft ----------- Vanmiddag komt KPN langs 5-oktober Klant belt in de 5 oktober in de middag terug Of morgen ochtend Klant kan nu inmiddels wel weer inloggen ------------ Bellen rond 11:00 7-oktober ---- Players zijn weer online', NULL, 11, 6, 1, '20cxe0n6jNlxY20tXlSrs5klL.20VxNro8nWvtQ20re42nyY42Dg8620t8M0x5pw3xA20QvvtoYyyicM20BVhwXSb11wY20Wm42fytyseBE20RMA11mD42b.k209DQvYMfhJ42w209kvrOQu8hgo20hsrP.WSKSGE20Jpf.QoPImSo20LZl4DZHzSZw20DXevzUtincY20pCJQ6PjWRaY20tBxNLUbS7GY20XZPV56bHahg20.JFfwLeZQEI20EQoEUux3wZs20JXWUDZt9PEU2047SAoVbovjY204LPTE6JNURc20PpOhlH5T8HU20jSGJA71gn5Q20KKEFbc3Jb2I20k9GTbU2vLpk20WZHxa3eQTmQ20YYAgVNrWNQ.20Hr1Sh2rNn9E2079xsHbTSOpM20iZ42upr8MeDc20.G5MsClXjdY20zgr6UyObar.20TaT42bJ0r.R220LZ7i7HVGqJs20Jl3AquHAVu620Fk1Cq88WJgE20c1vhSmdMNVc20lBzCu6DRt2.20H3mzWjETzKU200FZ2bWGt0wo20zBb0jBN5PK220bbXFlA7DsYE20WHbpYtGIAG620.Wdae3yuk2E20Jj5i7sydlro20STtuawK4ESs20a7ZA4b70mYY20G4uaHWfvbeI20GCw6LGUjWds200.6V7cbcSzM20jVeIpfy5rJQ20BK6V7o2.KX22042z6316jeNfI2016cBoQ1ZUgg205IblxtpBloY20grM1uyfAD3s20oLUI74w42TWs20DL5d21Nth0M20oEzw2HL1FxU207A.nGSi58bA20M42OaTipSsyg20VdwfGK2VcV.202D7hd8wfilo20pZM42u6okFcs20FSgAjE8jgE220QDVmS0pagx.205OodRtcN.Jk20sH42dA7oOAxc2042vFOKvG2Qww20hN9mHpUNy.A20mHsKBjOjM8220Hd8TIo4f8lw208YZDpKmtYQk20iUtJ6Sd7Y5s20kFo4T0L6ki220ZsIJYREtoUo205G9fQ42dyx3U20A29R9exEutc20nRYALSMo68M20Gd3fAmhj30Q20nasQL2gEmUo20qNv9MOsWPxY20yNTDrjLBkaU20YrGXgm2MMo620y9gZ0xWgjNc20txVKEWxiSRQ20cO.eJqvuwNk2079xsHbTSOpM20hAm0V2pb1.k20xbWFJ38BydU20W5z