(9, 9, 2, 2, 3, '2018-02-27 15:20:10', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'De schermen zouden omgewisseld moeten worden door Philips. Dit is niet gebeurt door een fout van philips. Die dachten dat wij dat zouden doen. Na een hoop gedoe zou MMD dit alsnog doen. We hebben nu nog steeds geen reactie van hun gehad.\r\n \r\n-------------Datum: 13-03-2017Tijd:10:29:50nossair@idsignage.nl', 'We wachten op reactie van philips voor het omwisselen van de schermen. Als we reactie hebben van Philips moeten we de klant terug bellen.\r\n \r\n12 oktober 13:22Inmiddels contact gehad met Philips over de schermen. MMD komt met een reactie over 2 dagen en dan hoort de klant van ons. Over omwisselen, want de klanten support kan daar geen toezegging over geven\r\n-----------\r\n21-10-2016\r\nMeerdere malen al contact gehad met main tech(MMD). Ze hebben een nieuwe MMD ticket aangemaakt voor de schermen en de foto\'s opgestuurd. Wordt doorgestuurd naar het hoofd kantoor en die gaan oordelen. Het eerste scherm wat is geleverd heeft geen vesa. Het 2e scherm wat is geleverd ziet er niet uit en is een oud model. De klant accepteerd dat niet.\r\nBarry die pakt het op door met Philips te belle\r\n------\r\n24-10-2016\r\nPeter heeft gebeld met philips. Mevrouw gaat er over praten met haar leiding gevende\r\n26-10-16 heb ik reactie\r\n-----------\r\n26-10-2016\r\nHet is door gestuurd naar het service centrum. De leidinggevende kon er ook niet veel mee doen. Morgen dus 27-10-2016 bellen met Main tech\r\n-----\r\n28-10-2016\r\nSchermen worden omgewisseld. Binnen 2 werkdagen wordt er een afspraak ingepland.MMD-161028-0027: Is het verkeerde model\r\nMMD-161028-0028: Model in slechte staat\r\n------\r\n31-10-2016\r\nSchermen worden vervangen. Peter heeft dit gecontroleerd bij Main tech en het gaat om de juiste schermen. Schermen worden binnen 2 werkdagen vervangen.\r\n \r\n----\r\n7-november 2016\r\nSchermen zijn inmiddels ontvangen\r\n-------------Datum: 13-03-2017Tijd:10:29:50nossair@idsignage.nl\r\nPhilips is langsgekomen en heeft het probleem opgelost.', NULL, 35, 6, 1, '20bwTiqGpRxy220S2ragC8qOUQ20aHhpYWtnNps20PZa1QKnDa.k20kYwJs0Mo2wQ20KK1etZWSlyE204mCaDUOFpB.20XarTj5GDoZw20QO4pMH2yNuM20HUZ4VXz5oys20uA3X8kujJVk20PZa1QKnDa.k20r2i.fuHPcJQ20KNEy5dJABRE20UWDZwZ9.XYU20Cxit6ESjcwE20a2GgezVIwTA20.P6fzWFr.no20PbxGzGzQszA20J29IHM5Wfx6.20I09Stoa6P9w206HNyZA.Iy3g20Wx1HJeOMfUA20RxSMGWa5DG.20xABjjz6UTm620IB8XqB563sU20j6qbDhCWPzs20Gv4EN0zmNWE20mNE8Hq68029g20iT0gVorJ0M620TpXN0uel4o.20cddgqGPjlOE20tIGHK2999aiw20bt1K5sWkdPA20cs0HMNru93U20RU37JDhIWtM20RFZNnUF9dkc20U4dwVRX1IRQ20omEOqXA5hIw20lViVA3bdk6Q20oJlilOZFiBo20JegNuASAimY20OrNGMI4yW.c20i290IxAwABuU202WrjVpvK.T.20ABKiSrjnGiw20u0Mb8lbWGrs20OM9tcLrEI9k20EB6XlMDfaIU20qRVAHym1SZA20CTasKUiLBsI20SNCO4Aur3wM20KbULgmYrpZE20a6uwphccG5E20A2wWA498MRw20Fe7tsGyb6is20E6Cg.wWvlPA20ZN29TejAM10620HUZ4VXz5oys20rGitPcW9l29g20c3bvyNqOOFs20gfUXB3qxqHM20Gg7sX2ExK.g20eH23NrZbL3w20S5Ri.X.8YOQ20j7QFbsVlcLo20ggtMAoA29vAw20ZjwN2kRAKuE20SK0radZSR4s20ciA9qme29LQ220Su29HKfyxJ2620CGNsvSULnLg20Rt29SK2KkTxQ20AetfY6J.NSg20l2oi29gn.YGc20h1nkK.T9MvE20rmowC5YzZCk20ptRTBV71LaM20iyXvF5do4c.20G2GQjntsMK62073TPVJm.wHE200aQvTp6mA5U20vbPCK4c296X2202MevuCMznts20Y8aLlFWB8PM20TzmAjS0uGqI20rae0HqBnLug20UiBv1r65c5E20og6pVrEvEDs20TY40faSKTho206ANOKxMbPWo204LcUYSeY4NI20c5y.NZaMeXM20llem9CCuv2E20a229WqSdtBWs206L10pO4o6kw20kwLN.693E9220hbeRtCJSDso20dC.5Uvb4.Zk20lsyqTfsv2929o20Nv1CaEVK4SE207vKQylzLnsE20ekuHixFlbAk20Td5NK7772Sk20m7boyU29pajU20W1HS6Y7XiFs20jFkxzzzCJ9k20SstYKCjxUd6201Hd537.wYJw2059t8Z0uU7bY20B8462pgmnp620yFPOA29ZUbgg206ErYKNfjVY6202MpSKS9IpXs20WO68qmcbzRI209NFu5rGZvrk20Z3tmqK6Hp8k200KfDI2K3zGs20UId7w7YFZoE20RrvKnvFrTLE20euW..S29bF7o20W8ZBiPQor1g20pSs78vMMx1220GYSJi643lIQ20afMRIH8UV9Q201ok6JWxy4Cg20QO4pMH2yNuM20pzLOvZydW5w20RxSMGWa5DG.204qY1IgxozHE20zMakhJhKJSI20RrDnXPgpZkE20qbh2SdOQifM20a6uwphccG5E20UiC29upQqn3.20JngkgrH0YHU201GpmLl06LYg20I4rTk09JwiQ20rae0HqBnLug20L3.aYSESzLo204s29CLw29MtrU20GEnA1m4u1Eg20ozLQj9ILoY.20TsjbR7BTWj620J9oMFS5UPBk20s5BXF