(16, 16, 104, 2, 3, '2018-02-27 15:20:16', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Meneer kan niet meer inloggen in het LCD menu. Dit heeft te maken met dat de acces denied is. Nu is er een oplossing om in de hardeschijf de file permissions te veranderen. Dit heeft Peter doorgestuurd naar Tim\r\n-----\r\n1-november 2016\r\nDe HDD kan worden gerepaireerd d.m.v. gparted.\r\n9 november bellen met de klant, want de klant is op vakantie\r\n \r\n-------------Datum: 06-12-2016peter@idsignage.nl\r\n-------------Datum: 13-12-2016Tijd:08:57:54peter@idsignage.nl\r\n-------------Datum: 16-12-2016Tijd:11:48:58peter@idsignage.nl\r\n-------------Datum: 20-12-2016Tijd:13:55:28peter@idsignage.nl\r\n-------------Datum: 21-12-2016Tijd:12:14:12peter@idsignage.nl\r\n-------------Datum: 21-12-2016Tijd:12:15:51peter@idsignage.nl', 'Nog niet\r\n--------------\r\nDe klant wilt de player opnieuw laten installeren [LCD menu player].\r\nPrijs opgaven + waar de klant het de player naar toe kan sturen mailen.\r\n \r\nMeneer Smith\r\nmail: info@geythorn.nl\r\n------\r\n15 november 2016\r\nPeter-> prijs opgaven verstuurd\r\n----------\r\n22 november 2016 15:45\r\nKlant neemt niet op.\r\n-------\r\n6 december 2016\r\nKlant zei dat die die player al had laten opsturen door iemand. Hij ging dit vandaag laten controleren.\r\n-------------Datum: 06-12-2016peter@idsignage.nl\r\nPlayer wordt vandaag opgestuurd we ontvangen hem wss morgen of overmorgen\r\n-------------Datum: 13-12-2016Tijd:08:57:54peter@idsignage.nl\r\nDe status van de player is alsvolgt:- Player start niet meer op in het lcdmenu. Dit komt doordat de LCD player een error heeft op de hardeschijf. \r\n-------------Datum: 16-12-2016Tijd:11:48:58peter@idsignage.nl\r\nPlayer is kapot en kan niet meer worden gemaakt. Een rapport maken voor de klant zodat we die kunnen leveren als onderbouwing waarom die het niet meer doet.\r\n-------------Datum: 20-12-2016Tijd:13:55:28peter@idsignage.nl\r\n-------------Datum: 21-12-2016Tijd:12:14:12peter@idsignage.nl\r\nBellen met de eigenaar: 0653255081Hilbert smith\r\n-------------Datum: 21-12-2016Tijd:12:15:51peter@idsignage.nl\r\nEigenaar op de hoogte gesteld dat de player dood is. De klant hoeft de player niet meer', NULL, 63, 6, 1, '20E.s3WkjtGbs20nlmcHdhr81Q20h4h0IVSSf0s20c1Ot4t06hA6206kpnguRxomI20eNzuUTK4jC620ERHZ3tjNLTo202VhKOIHEoZg20nXD5Ri1.FWs20ZLd.EUlaYps20lH8a2FRuJrE20rktv9yY3suY203lWTq46nMC2204kUyH..EIfg20DXLDAdi5qcw206xiZojtPncc20d.gokeHVb44U20BrMp1p7rGKs20jHLaIHIri44U20u44FaMalCheU20Y9ayArr7YnA20244QV4PL9yk6200Jrs5gtXzjo20YqujBJf8AJI20NCx44BDEOhkY20jUsbq6ocvnE20id1KKTtL06M20p1KlZb.cUIQ20H29mjRNlAKk20n9s4n8bckqo20gBFYTBSmgRw20Dpzm1Ts44Np620vOr1EUPmEdI20XrtaA3YCQyE207KnmPzV3.jA20aVjFDjFiUrM206GNQgOdbTQA20K2FWncyspUo20omeG4oQqpUI20bMdUeHrXUHo20.2Lj9GpabuE205nXmcOKnX7M20tUomoVGM7R6209X44DPIxuYo20QGsspdOaGJM20U8HqphTnDSc20zL4NuNn44Sy220wKnK67h328Q20Wt44xaBddvAs20iMmErghp0o620goWNhVEwbNQ20WTsi.ilXDMA20d1M3l52m2t.202fOYLM5rAwc20v1Z3A4NhaDM20q2hzF7JkskI20uE2w2CK59nk20qSZ0NxhTAs.20g0K2Kzpvgdc20lH8a2FRuJrE20QcrOYXuULVk20GzycWWSunog20wgxGyAtTumg20vvDRCunSio620VXFMSXOuYhY20rRLzXXkVIw220gxw029Cn8H620GaJsWC7449I20sLh4hAgDd1g20HG2eCXCWOyQ20mTEDB42S6Bw20N0rhnj97uVo20vf6uV.3GxNI20na0wG443zQOs20aGqB8XNHGJc20G8oAd9ETXIs205vvoef8fO44c20dmlAAxv2xiQ20VECEGVDWAjw20QjwoQFTCamU203B3u3vEtHeg20P6YQoTffx5.20RzAYaXwd9JU20GaJsWC7449I20qNnJCRyM7Rw20aP4wpY7wBEE20ZxkHqhyr9OY2044Nc9UZ1tqGA20DB5HcLAEkxE20wt90Ziz2aZQ20BR1IKOJJM1Y20sP574rNxuT620IXgDAul4KsU20.ewkYr3UR5c20JE5WcLV1BLA20mfrp.gK0L.M20aRdMrKp4kwM20gdI1q80GpDc20sf3o1JXBqI.20Rz7pHc44e14Y20xRNYeCx8IFc20PDPYJF.ZZ0Q206yJFI0W44fVk20BN0HibPsWEo205445vd4WFs5A209mo7V06ZZyc208ivAEPpoos.20nlmcHdhr81Q20YFblfDzvz3g205MAvmwULD3220.44WUqDznIbk20mYgNjA90l3g20sUe9rZ5dpIs20y0s44PaGJWZY20aD04qNVVmc620x7cWr8nEAMo200rZDYSPxTBc20hkr.PjpqQmM20P4MjkbZ30VQ20YL2hgwu44B1M20DibwLemzTbA20Gr1rhlcIukA20EWsbuYDvzs.20YL2hgwu44B1M200.vHTgzFB5k20EMitvGNjPas20Qz.lD8FUBio206R42wqVK.A2206R42wqVK.A22038Dk28u6442Q20dtvO8Kb447pU20znz8iJtm2UQ20UvcKC32h44YU20tpV6oM5x