(21, 21, 20, 2, 3, '2018-02-27 15:20:23', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Maandag middag bellen om 13:00. \r\nZe moeten hun LCD menu updaten, de thema\'s. De klant weet zelf niet hoe dit moet.\r\n \r\nZe hebben het volgende mailtje gestuurd:----------\r\nVan: Petra Ros-de Deugd Datum: 4 november 2016 16:02:53 CETAan: "support@digi-menu.nl" Onderwerp: Help.\r\n \r\n\r\n\r\nGoede middag,\r\n \r\nWij hebben twee LCD schermen van LCD MENU. Deze moeten geüpdatet worden maar wij krijgen het niet voor elkaar.\r\nIs er een mogelijkheid dat een van jullie medewerkers ons via de telefoon door dit probleem heen helpen.\r\nGraag van tevoren een telefoontje zodat wij aanwezig zijn in het bedrijf.\r\n \r\nAlvast bedankt voor de moeite, met vriendelijke groet,\r\n \r\nPetra Ros-de Deugd,\r\nLunchroom-Eetcafé Plein 10, Nieuw Lekkerland.\r\n\r\n', 'Peter pakt dit op\r\n11 november bellen om 12:30\r\n \r\nStappen mailen met daarin hoe ze het LCD menu kunnen updaten\r\nemail:jordy_vdwal@hotmail.com\r\n------\r\n15 november 2016\r\nPeter:\r\nMailtje gestuurt met daarin de informatie hoe ze het LCD menu player moeten uodaten', NULL, 83, 6, 1, '20hDG8BuLrX3M20i48w.83m3n3o207uR048sTwi0k20lxKJ9FcvIs620Xj.lLIEFW.620gJklzWytQTc20oJPmu2fCNts205y48qeQHrTHw20d1bgsQlF04I20OR7cHg6fQUQ206hAWifrO.Mc20Ofe1Bg3538M20.ULIgnGFCSo20JBJBiQJ48eM201x48spyTyV4A20r4tPjGf8W2.20ubCboGjRMnQ20SmRRRgqNIDc204PVmFRrIJtI20XBdD948B9Zbo20WEaho5c4Rn220svWooUFNE7g20A89xXeDzXzA20eU980Cd1fJg20s0YSZl49Bdc20hPVOF91Y6Fg2048obX1VETpTU20w1rOkIEdI9Q20l1s05G3xI8Q208jUZD0S6hP220CjNVGqOBeoQ20r4vGXYnOmFw20oLBSmxhKvNE20gJklzWytQTc20bWXDRTFCQn.20HXhDd3s5TpE20wuBihfR.4yQ20xMCTlZaYMSc20jcHNCnPhato20JcHzJ1MwNfo20okAixtFXP7k206Fxmx1P16o6204FjzMxbJ27I20cu.TQ4KNiGU20bncNfHzrmr620qDlcsk..GmE20IftDih0tqps20P48RJ738fa48o20U8KCyKRW.Zw20CTx7MsqKgFA20fsSeyuyMznA20lBpgZ48zhw4w20J6PfqEjhIEY203cZOEV.21Ho20k6wHTwAL0BE206XknuiJEJJg20sRD8s48lR91620NorrYGUgIjU20bSuh7jg0Tps20eM5Vlh37HEQ20soildv60WCo20eM2kbSHKd0I20cwYz1lkjmL.20l6QG27BAOWA20