(23, 23, 23, 2, 3, '2018-02-27 15:20:28', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Het pakket van POSTNL is volgens de website ontvangen. Echter is deze niet ontvangen door de klant. \r\nHet pakketje is ontvangen door Peter, terwijl de klant Yves heet.\r\nDe klant heeft ook geen "we hebben u gemist kaart gevonden op zijn deurmat".\r\nPakket tracking code: 3SKABA4263555Postcode: 9630Land: Belgie\r\n \r\nMailtje van de klant: \r\nVan: "Yves" Datum: 4 november 2016 21:17:07 CETAan: "\'Barry Contze\'" Onderwerp: Antw.:â¨ Verzend bewijsâ©\r\n \r\nDAG Barry,Ik heb de barcode ingetikt op de website van internationalparceltracking.comVolgens PostNl is het pakje op donderdag 3 november afgeleverd en er werdeen handtekening geplaatst en de naam Peter ingevuldDit is echter niet in werkelijkheid gebeurt. Ook de buren weten van nietsIk heb ook geen afwezigheidskaartje gehad met verdere instructies.Ik kan op de website echter niet zien hoe ik een klacht kan indienen of hoedie chauffeur kan worden benaderd en geconfronteerd met de feiten.Het is niet de eerste keer dat chauffeurs zelf "afleveringsbewijzen"aftekenen en de inhoud voor zichzelf houden, maar wat kan je in hemelsnaammet een player doen ?Wil je zo vriendelijk zijn na het weekend eens te informeren wat me te doenstaat ?Met vriendelijke groeten en prettig weekend gewenst,yves-----Oorspronkelijk bericht-----Van: Barry Contze [mailto:barry@idsignage.nl] Verzonden: vrijdag 4 november 2016 18:45Aan: danyvan@telenet.beOnderwerp: Verzend bewijs', 'PostNL gaat dit uitzoeken. Over 2 dagen 9-november 2016 krijgen wij hierover terug koppeling\r\n-----------\r\nDe post bezorger zegt dat hij het in de brievenbus heeft gedaan\r\ndit is echter niet het geval. PostNL gaat dit verder uitzoeken 9 november\r\n-----------\r\n10 november 2016\r\nReactie terug van PostNL:\r\nGeachte heer Contze,Op uw verzoek heb ik onderzoek gedaan naar uw pakket dat is verzonden metbarcode 3SKABA4263555 aan de postcode 9630, te België. Uit het door mij uitgevoerde onderzoek is gebleken dat het pakket bij degeadresseerde is afgeleverd.De chauffeur geeft aan de zending in de brievenbus te hebben geleverd. Dechauffeur is aangesproken op zijn onjuiste werkwijze.Ik hoop u hiermee naar tevredenheid te hebben geholpen en geïnformeerd ensluit hierbij het onderzoek. Mocht u nog vragen of opmerkingen hebben dan kunt u ons van maandag tot enmet vrijdag van 08.30 tot 20.00 uur te bereiken op telefoonnummer  058 - 2333371.Met vriendelijke groet, Mark HietkampServiceteam Zakelijk PostNL Pakketten Benelux B.V.ref:_00D30VG9Y._500D01JDSb4:ref\r\n \r\nScherm 4 gaat om\r\n------\r\n22-11-2016\r\nplayer is klaar gemaakt en word vanavond opgestuurt naar:\r\nBvba danyvanBiesstraat 2 B19636 NEDERZWALMBELGIE', NULL, 91, 6, 1, '20nqG36DAfbsHA20Li8xSnggiDg20FLAgTtGBFd220gnb6pgIi3X2203QfMGJMMZOk20zBV1umZtXRY20Cr2cwDZEccA208ajSZjDSPcM20UopAT9lSdjM20P.zvKKF36hao20FH36fMB3w.lM205q36LyOW3d3s20sEipuxKUfNI20N8flBwLbJlU20Pi7L1vstdCE20cAbn8Tl9EqA20d0GzQQzsL8w20jDcOuKX4npo20NjfsmWVWR3Y202TVz7nZdwdk202qQk3mzlnm620YyW1tL57eWY20bH.ucD2Rxkw20lXRLRso.0Jk203w9q8P6p75220tJtPpcCUf5s20WMfdMzZLc3M20Vc.WYZoP36kY20ip6Lmcb08gg20BDXnLPICzLw204gUkCAUQuQM20dnN8HOR1.p2207iFy6c1GezU2010EFoLGj7z.202FLsAAnP36RI20PD30dA3JdPM20q.OaxqNEewY20z9u0k9rkPSE201d3Qk2l3mQU20xlj.F9nCR5M20MR1yOCn3xFw20SNB436X3DNj220OUoxDExYHf620.ZldidUa8qk20FHNQmoJegdA20cTf3QhzUf4E20tiZlshnwxlc20XlZbNe3fP6U20yruj1MVEisM20zrL2B7vc.bM20E365.p51SXqI20hlLGTcll7Vo2010P01F9fgRI20rxdYgLB2xsg209bxFZbDef2w20QX62gsmWHSA20vdjKnIGtMD.2036dncLRDXdFo20ogHsIt1.J7w20URgnIMiJ0Yw206STq8QEV3NE20HnrnPIuEWro20TgI9hMZONfU20f4LhQGs6M36c20D0SnMfrF1Og2026T4vZsFaOk20DehjF2WWJ3U20QyvgInYxGLY20xLBfjfFGqTg20IUm9QqcyWyQ20NDqWt36LIUWE20evspfoR.zrc20VvWEwLkAkFk20m1O7bhocOSM20fX8F0jm8VLI20360vegaa1VS620mPXz4iY8HwQ20HU3P.Fm9Vs620FgOjc8mATlU206i5LG69bzJQ20tmhditYhg36k20ryOhf3UKNdI20E365.p51SXqI20antPYfJzhfk20xXq03drXD9U20nHXhppm1oDc20aS1uY63IKuU20ZRTE0pRD41A20IANPy1mMmlw20RfO8OQuSZW220qV355HCVe2s20fODQU3q6haA20J8EOk3vcEnM20b2.LQvw