(29, 5, 5, 2, 3, '2018-02-27 15:20:38', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'De klant heeft 3 players die kapot zijn, U2. Deze moeten nagelopen worden. Hij stuurt de players vandaag op 16-november2016.\r\nAls ze niet meer te redden zijn dan moet de klant gebeld worden en zeggen dat hij nieuwe players moet aanschaffen.', 'Flashen en kijken of die stabiel draait\r\n------\r\n21 november 2016\r\nPlayers zijn stabiel en worden terug gestuurt\r\nPlayers worden gestuurt naar:Dorpsstraat 21Cothen, 3945BJ\r\nDe volgende U2 players werken weer:Scherm 3Scherm 7\r\nScherm 8 is kapot gegaan. Tijdens het testen. Nick is hiervan op de hoogte gesteld. Hij zei dat hij ging sparen voor 3 nieuwe players.\r\nDe players worden vandaag opgestuurt op: 21-11-2016', NULL, 115, 6, 1, '20qs9iPIyHTsk20jA9O6mPUKNM20qxcopwbJCT6209wfqOtgj25cY20UA0ZieGIGhs20qp4iY6pPavY20CN9OMu..RXk20MmXC25T825RbE2009saSxHEwWE20JeI4sDq4UBU20aecQj49WeXw20z1NCUr.T5Zs20bfTKWpuUxf220BVblGtazH.s20iEOjPPmeDoE206q36uDLsnOc20vxvYXS1BH4o2076yzL7KkQCg205bLjdKEGfU220.Xrwyuyz7ek20VbedgVyLg8Q20J3U3EamTcoE20rWn5u6Wx02620AAzmW6HSR9o20.254DIXst4Jc20T11KH8CHQGs209qSXhk5gC3s209ny.mH0i98Y20HpF4dO9vQsw20JcpJiQFbIgk20B3L4hHrM.B220BmirvN0RUzk20T258v9Al32xw20Eb1TTsv19Qc202xHqkNXovgA209qSXhk5gC3s20M4YZWl8J8gE20WrqroOmMsMA20Zx88uh0X24A20lRjzwC4UN4k20wsDrq025U3Vg20.7DWQXz6mDY20.U05v3f8ovk20K8O7bu2AJCY20rQnLeS0pJ4o2040gtfcG9hZE20nQhFllLTKuA20F1kFPrW1aQI2093Z.HRsVLg220XWtaAsysCk.20GtuuM5jGjwg20F8FE36tEL7o20gav2uSz2OP620b02EDnJg6Bc20oYihEMsGjxw20g925aTodp.0s206Ys.3u36qsg20LJw4dwnUC6k20i9vZykGz1Pw20BjjGHrQvKKs202Ou25KlPVMww20T4IXZRVRSkM20K1undTo0qYs20aC4xBQBBeFQ20zRdAwtKhfxE20UFyRzqpLUo620GZzHWk0SrXE20EKLCnH4kicw20QZBIPEg7YJ2209I0A2KDAUqo20f6BU4hiIDbo20uoF7P9Zcnoo20aVPprCqayK220dt2KtBl6f1Q20U2oJn0BU95k20lkViEHV.mzU20IBjFbhzolU620sI3uuGukixk20NICEbxPRKM620M4YZWl8J8gE20onXTJTzBApQ20Pxcl8ut4nEE20zQK70i257kFM20oSNIqQNqGuA20valYodr4QOk20CxCv0TA0oIA20h6REZ425LC3w20XbwJuFPXL4.20bsgqBcA0Hfo20YDHzffkDRbQ20H6fYyt6kEjc20Pxcl8ut4nEE20xX25Vh7ddVL