(35, 35, 104, 2, 3, '2018-02-27 15:20:51', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Mijn naam is Henk Andy en ik help Snackbar \'t Pleintje uit Heerenveen met het vernieuwen van de content op hun TV schermen (3].\r\n \r\nWe willeneen nieuw template maken: Aanbieding van de maand  +  . Prijs geldt voor alle aanbiedingen die worden geplaatst. Op deze pagina de mogelijkheid tot het plaatsen van 4 aanbiedingen: Naam van de aanbieding dus zonder prijs... (want deze staat al generaal vermeld].\r\n \r\nOok willen we uitgelegd krijgen hoe we foto\'s kunnen plaatsen. De resolutie moet waarschijnlijk 1280 x 720 zijn? \r\n \r\nHoe is het mogelijk om een video te plaatsen? \r\nIs het ook mogelijk om de weergave over 3 schermen te verdelen? Voorbeeld een kurk die knalt van links naar rechts over 3 schermen?\r\n \r\nNou, dit was het zo\'n beetje. Indien er kosten aan verbonden zitten, dan dit graag even afstemmen met de eigenaar van Snackbar \'t Pleintje. Ik doe hem deze mail toekomen via .cc (Marcel van der Wal via mailadres: jordy_vdwal@hotmail.com].\r\n \r\nMede gelet op de feestmaand december die er aankomt, zou het mooi zijn om e.e.a. deze week opgelost te krijgen. Alvast dank!\r\n \r\n \r\n \r\n\r\n\r\n\r\n\r\nâ€‹\r\n\r\n\r\n\r\n\r\nMet â€‹sportieve groet,\r\n\r\n\r\n\r\n\r\nHenk Andy\r\nâ€‹06-22625689â€‹\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n', 'Opgelost, de klant begeleid met het oplossen van zijn problemen', NULL, 139, 6, 1, '.209OKfrHIq6r220lEiaelIouBw20xnPh9V0q80E20GYXwVUhK.3A20WpHm241ai25s20I5Gsg5GEqHg20rRCVmMLLlqc20aOOYOCutULo20Vs.KOI9G4.k20MZ68YOZPbns20aDPvD41hlKRg20VbbOMabqymQ205FQ23v41GNJ620sF4EtkX9SJg20ndPilsY23Vc20.Pl2PVo190s20zB6a6F41maEo20R5hK257BRqQ20je15GC13ndA20isiUhavIqC220IeJkIIvCcTE20yyphc5lNm41Q200I8dozpV41U203x6vATW3i9.20XiJXgvBGJ.M20Qmm7yMe3x1.203rkbdUzlGk620OWnzNcvPZRg20E56pH5SK.Jk20vSL369zm0VI20w6GKgKhwuZo20DXykuvq.oPc20k410v08dMFWQ20RuKJ9HZwfsk20W4418XgofWR.20W7YrV76k0P.20hW.ej09gX0620va10tBn0SpU20zrcKYlxkEwk20LtQRVTTh4i220eqUjLlGCheY20A.holbuH9qg20