(41, 41, 2, 2, 3, '2018-02-27 15:21:01', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Datum: 06-12-2016Tijd:12:55:43peter@idsignage.nl\r\nDe klant wilt een handleiding voor het model: BDL4230EC/00\r\nemail: info@hoteldevriendschap.nl\r\n-------------Datum: 06-12-2016Tijd:13:02:57peter@idsignage.nl\r\nEmbylight is kapot en kan ook niet gemaakt worden.\r\n \r\n-------------Datum: 13-12-2016Tijd:11:09:46peter@idsignage.nl\r\n-------------Datum: 16-12-2016Tijd:15:15:41peter@idsignage.nl\r\n-------------Datum: 16-12-2016Tijd:15:59:17peter@idsignage.nl\r\n-------------Datum: 21-12-2016Tijd:12:13:42peter@idsignage.nl', 'Datum: 06-12-2016Tijd:12:55:43peter@idsignage.nl\r\nemail: info@hoteldevriendschap.nl\r\nIk heb het gestuurd naar philips voor de handleiding.\r\nZe willen graag een afstandsbedieing van hun schermen\r\n-------------Datum: 06-12-2016Tijd:13:02:57peter@idsignage.nl\r\nAfstandsbediening krijgen is niet mogelijk. Omdat het scherm niet meer gemaakt wordt.\r\nDe led rand kan waarschijnlijk niet worden uitgezet, omdat dat toen der tijd is gemaakt door een ander bedrijf.\r\n-------------Datum: 13-12-2016Tijd:09:03:47peter@idsignage.nl\r\nKlant moet vandaag gebeld worden.\r\n-------------Datum: 13-12-2016Tijd:11:06:08peter@idsignage.nl\r\n-------------Datum: 13-12-2016Tijd:11:09:46peter@idsignage.nl\r\nKlant wilt dat we het systeem een keer komen uitleggen.\r\nZe weet niet goed hoe het LCD menu in elkaar zit. Dat we voor haar rustig de tijd nemen en het goed uitleggen.\r\nKosten wilt ze graag hiervoor betalen.\r\n-------------Datum: 16-12-2016Tijd:15:15:41peter@idsignage.nl\r\n-------------Datum: 16-12-2016Tijd:15:59:17peter@idsignage.nl\r\n-------------Datum: 21-12-2016Tijd:12:13:42peter@idsignage.nl\r\nLeroy pakt dit op.', NULL, 163, 6, 1, '20HwJK88qfd2I204V6V2tqykhE20Gp5K52SrYiIQ204FQ1XBYjHQA20ofHXiFi.oWY203WN5qTPfSio20M52ffw5B152G.20S4zsF6bXsxg20jEltDkSZNJk20O4YuFu2o3KU20v2kyRyfgf5g207NKVlnRNCWQ20cWtpIkfyKqk20Qg6O4G52HSgo2010g1IkOYIGs20MFgijGMFa2Y207NKVlnRNCW