(72, 72, 5, 2, 3, '2018-02-27 15:25:21', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Datum: 03-01-2017Tijd:11:29:35peter@idsignage.nl\r\nDe klant stuurt zijn deplayer op van scherm 6 om deze te resetten\r\n \r\n-------------Datum: 03-01-2017Tijd:15:09:47peter@idsignage.nl\r\n-------------Datum: 03-01-2017Tijd:15:10:01peter@idsignage.nl\r\n-------------Datum: 04-01-2017Tijd:14:04:25peter@idsignage.nl\r\n-------------Datum: 04-01-2017Tijd:14:13:46peter@idsignage.nl\r\n-------------Datum: 04-01-2017Tijd:16:42:43peter@idsignage.nl\r\n-------------Datum: 04-01-2017Tijd:19:04:54barry@idsignage.nl\r\n-------------Datum: 04-01-2017Tijd:19:05:08barry@idsignage.nl', 'Datum: 03-01-2017Tijd:11:29:35peter@idsignage.nl\r\nPlayer flashen en terug sturen\r\n-------------Datum: 03-01-2017Tijd:15:09:47peter@idsignage.nl\r\n-------------Datum: 03-01-2017Tijd:15:10:01peter@idsignage.nl\r\n-------------Datum: 04-01-2017Tijd:14:04:25peter@idsignage.nl\r\nPlayers is gereset en lijkt weer te werken.\r\nPlayer opsturen naar:\r\nVoorstraat 20Beesd, 4153 AL\r\n-------------Datum: 04-01-2017Tijd:14:13:46peter@idsignage.nl\r\nPlayer in de envelop gedaan en wordt door barry opgestuurd.\r\n-------------Datum: 04-01-2017Tijd:16:42:43peter@idsignage.nl\r\nFuctuur sturen naar -> info@voorhuysbeesd.nl\r\nEU150 minix5\r\nVerhaal erbij zetten dat de player niet meer te redden viel door een hardware fout.\r\nOpmerking: Joyce was zwaar beledigd dat wij niet de player gelijk opstuurde met de facuut erbij en dat ze eerst moest betalen.\r\n-------------Datum: 04-01-2017Tijd:19:04:54barry@idsignage.nl\r\n-------------Datum: 04-01-2017Tijd:19:05:08barry@idsignage.nl', NULL, 287, 6, 1, '20vcPkQT5t138E20fvDuMQ0Hcqk20yVQACODCyQE20US26ByiZgpY20yNA5J1Pk0aM20Iiz50pkM113s20D5OK13I14ynw20raE.xYcFjpw20yB7lTe44gl2203BQRJQSKiBE20BRIW86HMjPU20pKIZFitF2Is20zahULqD9kaw203rtMzel38yI20TQ6VZIXnXOs20Qz1nLuoNAbM20Bf6Iv7nVbUM20UJq5oIzYe1U20CipmgzwB3OA2056Pz.uTYq0s20wv13BHaN3pos20hcdR5JKqkxM20iZVSYmGvzOQ206naMtScHQIA20OmXldPjN