(107, 107, 30, 1, 3, '2018-02-27 15:26:15', NULL, NULL, 'Datum: 03-03-2017Tijd:09:50:52nossair@idsignage.nl\r\nPeter had met de heer Braam meegekeken. \r\nMaar Braam gaf dat er een probleem is aan de \'tuner\'.\r\nBraam had z\'n schermen destijds bij LCD-menu gekocht.\r\nWou weten hoeveel de \'tuner\' nu zou kosten.\r\nGraag meer informatie.\r\n-------------Datum: 03-03-2017Tijd:11:01:40peter@idsignage.nl\r\n-------------Datum: 03-03-2017Tijd:12:18:33peter@idsignage.nl\r\n-------------Datum: 03-03-2017Tijd:12:18:43peter@idsignage.nl\r\n-------------Datum: 03-03-2017Tijd:12:22:14peter@idsignage.nl\r\n-------------Datum: 13-03-2017Tijd:17:14:47peter@idsignage.nl\r\n-------------Datum: 11-04-2017Tijd:15:27:31barry@idsignage.nl\r\n-------------Datum: 11-04-2017Tijd:15:28:24barry@idsignage.nl\r\n-------------Datum: 06-06-2017Tijd:15:39:58peter@idsignage.nl\r\n-------------Datum: 06-06-2017Tijd:15:52:32peter@idsignage.nl\r\n-------------Datum: 12-06-2017Tijd:16:12:05peter@idsignage.nl\r\n-------------Datum: 15-06-2017Tijd:13:02:11lydia@idsignage.nl\r\n-------------Datum: 11-09-2017Tijd:15:12:25barry@idsignage.nl\r\n-------------Datum: 11-09-2017Tijd:15:12:43barry@idsignage.nl', 'Datum: 03-03-2017Tijd:09:50:52nossair@idsignage.nl\r\n-------------Datum: 03-03-2017Tijd:11:01:40peter@idsignage.nl\r\nPrijsopgaven nieuw systeem\r\n \r\ninfo@vishandelbrassem.nl\r\n2 schermen.\r\n-------------Datum: 03-03-2017Tijd:12:18:33peter@idsignage.nl\r\n2200€\r\n \r\nRelatie korting\r\n€1800\r\n \r\n2 players\r\nInstallatie \r\nNieuwe content\r\n \r\nBinnen 1,5 week\r\n75% aanbetaling\r\n \r\n25% na oplevering\r\n-------------Datum: 03-03-2017Tijd:12:18:43peter@idsignage.nl\r\n-------------Datum: 03-03-2017Tijd:12:22:14peter@idsignage.nl\r\n-------------Datum: 13-03-2017Tijd:17:14:47peter@idsignage.nl\r\nDe klant wilt graag weten hoeveel het verlengen kost van een licentie van 3 jaar.\r\nDe klant wilt ook graag dat het voor 10:00 geinstalleerd is.\r\n-------------Datum: 11-04-2017Tijd:15:27:31barry@idsignage.nl\r\nMeneer gesproken wil het toch graag als het maar voor 9 uur werkt.\r\nBelt week na pasen over ja of nee\r\n-------------Datum: 11-04-2017Tijd:15:28:24barry@idsignage.nl\r\n-------------Datum: 06-06-2017Tijd:15:39:58peter@idsignage.nl\r\nVan de week overleg\r\nVrijdag bellen: 9 juni.\r\n \r\n-------------Datum: 06-06-2017Tijd:15:52:32peter@idsignage.nl\r\n-------------Datum: 12-06-2017Tijd:16:12:05peter@idsignage.nl\r\nNam niet op.\r\n-------------Datum: 15-06-2017Tijd:13:02:11lydia@idsignage.nl\r\nVandaag gesproken met de vrouw van Braam, ze hadden weer een probleem met de player en de zonen van haar hebben\r\nhet opgelost.\r\nPeter het is beter om toch te kijken of je de eigenaar op zijn 06 nummer te pakken krijgt, beter niet verhandelen\r\nmet zijn vrouw.\r\n-------------Datum: 11-09-2017Tijd:15:12:25barry@idsignage.nl\r\n-------------Datum: 11-09-2017Tijd:15:12:43barry@idsignage.nl', NULL, 427, 6, 1, '20GdK3CkKrl2A20tCTYGuxqr5220HJX31SqTkv9g206GabEH.EooA20u9MgKSqrBnw20GGF80xClIYc205kwRBGU2FQs20ohqbld4OpS.20BKjoSW8jpgw20B831n1x34tUc20Hvv8ZEv0UYU20XrqQz31EbuE20CvxFotS4FGk20A2q31PvkKcuU20aBCAO1O1JkI20NPUbgPzcIWY20cDo1xgnMfBs20C1S78unOMZ.20AITHaoc3ZnM205rfpK82i7a.20PkpmmzW31upg20dJw4CYQe7pY20425cJNHbzdY20FweQ5oI.oh2209t1hv.8gl9A20MAHygVWG5gk20VO68b7z27aw20rgRQXdJGCUA20JFeqYC317E9A20MG7czId57tU20Vf8cPlVLel.201QIBQKiNuu220.8zg3CsF4hs20XF31I6HodVHE209Dz3lxYwJcQ20ebwnJFGHPZg20K02HzNEFBY.20uKWCUYEc6CI20pOxOyvIXBk220OtIDznvaZwc20cKiWDzjTrZg20uXOnH6vt9a620i12cZFMYJQ.20LGxnuE31ikAg2056u34UvpCqs20uXOnH6vt9a620DYDW0aB.zAc20Z0dpbGCp8MQ20MYwyVUfuJQc20bINrj.Z2EaA207GR5uxU.OrE20uxVB1dtMmM.20Aram3sXx8JQ20tXrAy9hKcPQ2057RWQMmcUN220QU1m.iIPUaw20wJPqxT31Xc0220f.evFw.kz4M20Z310mbgwi4uA20qyCgKvYSmK.20VQmKT8UtrLc20hA3mq6GJTUs20ZWXREGbLrKg202oA9hp96j5620oy64Seh6fBw20atfbSR6uZrY20OtF431cIZqUM20Jv4yxZx4gPI20a2SHuZOVjN620ptYiw70dEDg202ePW4IaAHcs20QFrRSaDnIVs20TiJor1JBlzM20OBoKpquwXJ620WIouWEaSWDo20v8VGWdzv4Jw20YaH96ID1OFY20.w3rz1lqD6k209zP6AECWlAQ20UzMO7ueKkZ220xWkE