(123, 123, 104, 2, 3, '2018-02-27 15:26:52', '2018-02-27 15:30:20', '2018-02-27 15:30:20', 'Van: Vera Lenting [mailto:Lenting.V@roompot.nl]  Verzonden: maandag 10 april 2017 15:50 Aan: info@digi-menu.nl Onderwerp: Digitale menuborden Callassande\r\n \r\n \r\nGeachte lezer,\r\n \r\nNa 4 maanden zijn wij weer geopend. Ik wil heel graag onze digitale menukaarten aanpassen maar helaas kan ik niet meer inloggen. Er is ooit een emailadres gekoppeld aan jullie maar ook deze weet ik niet omdat dit voorheen door iemand anders beheerd werd.\r\n \r\nKunnen jullie mij verder helpen? Het gaat om Vakantiepark Callassande, gevestigd aan de Voorweg 5a 1759NX in Groote Keeten.\r\n \r\nIk heb ooit een link gekregen om in te loggen: https//192.168.2.222 maar ook deze werkt niet. \r\n \r\nIk hoop dat jullie mij verder kunnen helpen!\r\n Telefonisch ben ik ook bereikbaar op: 0681351030\r\n \r\n \r\nMet vriendelijke groet / Mit freundlichen Grüßen,\r\nKind regards / Cordialement,\r\n \r\nVera Lenting\r\nAllround medewerker\r\n Vakantiepark Callassande \r\nVoorweg 5 A\r\n1759 NX Callantsoog\r\nTel.:  +31(0]224-581663\r\nMobiel: 0681351030\r\n \r\nE-mail: lenting.v@roompot.nl Website: www.roompot.nl\r\n  \r\n-------------Datum: 10-04-2017Tijd:17:36:06peter@idsignage.nl\r\n-------------Datum: 10-04-2017Tijd:18:06:13peter@idsignage.nl\r\n-------------Datum: 10-04-2017Tijd:18:06:45peter@idsignage.nl\r\n-------------Datum: 11-04-2017Tijd:11:33:36barry@idsignage.nl\r\n-------------Datum: 11-04-2017Tijd:12:47:08barry@idsignage.nl\r\n-------------Datum: 11-04-2017Tijd:16:21:13barry@idsignage.nl\r\n-------------Datum: 12-04-2017Tijd:16:17:37peter@idsignage.nl\r\n-------------Datum: 23-04-2017Tijd:15:44:40peter@idsignage.nl', 'Datum: 10-04-2017Tijd:15:53:20barry@idsignage.nl\r\n-------------Datum: 10-04-2017Tijd:17:36:06peter@idsignage.nl\r\nGebeld.\r\nZe ging overleggen met haar manager of het goed was dat ik langs kwam. Ze belt mij hier zo over terug. \r\n-------------Datum: 10-04-2017Tijd:18:06: